            function loadHome() {
                document.getElementById('main').innerHTML = '';
                for (var k in years) {
                    document.getElementById('main').insertAdjacentHTML('beforeend', `
                <tr class="clickable-row" 
                onclick="showExam(`+ k + `);">

            function showExam(k) {

                    for (var k in json) {
